import _ from "lodash";

const Paging = ({ itemsCount, pageSize }) => {
	const pageCount = itemsCount / pageSize;
	//const number = 1234;
	const n1 = _.range(1, pageCount + 1);
	console.log("range", n1);

	return (
		<nav>
			<ul className='paging'>
				<li className='page-item'>
					<a className='page-link'>1</a>
				</li>
			</ul>
		</nav>
	);
};

export default Paging;
